import React from 'react';
import './App.css';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import About from './pages/About'; // Update the import statement to the correct path

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/about">About</Link>
            </li>
          </ul>
        </nav>
        <hr />

        <Switch>
          <Route path="/about" component={About} />

        </Switch>
      </div>
    </Router>
  );
}

export default App;
